    clientId: '12dac98b658f492091542cd6c4babb6c'
})

const DashBoard = ({ code }) => {
    const accessToken = useAuth(code);

    useEffect(() => {
        if (!accessToken) return 
        spotifyApi.getMyTopArtists().then((res) => {
            console.log(res.data);
        }) 
    }, [accessToken])

    return <div>{code}</div>
};

